namespace Misc\Object\Values;

class ValidIPAddress  {

    public function __construct() {
        
    }

    public function valid($ip) {
        foreach ($this->disApi as $ikey => $ivalue) {
            $split = explode("/", $ikey);
            $ipSource = $split[0];
            $subnet = $split[1];
            //prepare subnet
            $mod = $subnet % 8;
            $position = $this->rangeSubnet[$mod];
            $offset = 255 - $position;

            $netmaskSubmnet = array(
                $subnet >= 8 ? 8 : ($subnet >= 0 ? $mod : 0),
                $subnet >= 16 ? 8 : ($subnet >= 8 ? $mod : 0),
                $subnet >= 24 ? 8 : ($subnet >= 16 ? $mod : 0),
                $subnet >= 32 ? 8 : ($subnet >= 24 ? $mod : 0),
            );

            //convert ip to network
            $ipDigital = explode(".", $ipSource);
            $ipBinary = array();

            $netmask = array();
            $binaryNetmask = array();
            $wildcard = array();
            $binaryWildcard = array();
            foreach ($netmaskSubmnet as $key => $value) {
                $mixedValue = $this->rangeSubnet[$value];
                $netmask[$key] = $mixedValue;
                $wildcard[$key] = 255 - $mixedValue;
                $binaryNetmask[$key] = str_pad(decbin($mixedValue), 8, "0", STR_PAD_LEFT);
                $binaryWildcard[$key] = str_pad(decbin(255 - $mixedValue), 8, "0", STR_PAD_LEFT);

                $mixed = decbin($ipDigital[$key]);
                $endValue = str_pad($mixed, 8, "0", STR_PAD_LEFT);
                $ipBinary[$key] = $endValue;
            }
            //calculator network
            $network = array();
            $binaryNetwork = array();
            $broadcast = array();
            $binaryBroadcast = array();

            for ($i = 0; $i < 4; $i++) {
                $initBit = "";
                $initBroad = "";
                $charIpAddress = str_split($ipBinary[$i]);
                $charNetmask = str_split($binaryNetmask[$i]);
                $charWildcard = str_split($binaryWildcard[$i]);
                foreach ($charIpAddress as $key => $value) {
                    //echo $value, '-', $charNetmask[$key], '-', ($value == 1 && $charNetmask[$key] == 1) ? 1 : 0, "<br>";
                    $bit = ($value == 1 && $charNetmask[$key] == 1) ? 1 : 0;
                    $initBit .= $bit;
                    $initBroad .= $bit | $charWildcard[$key];
                }
                $binaryNetwork[$i] = $initBit;
                $network[$i] = bindec($initBit);

                $binaryBroadcast[$i] = $initBroad;
                $broadcast[$i] = bindec($initBroad);
            }
            //var_dump($network);

            $myIp = ip2long($ip);
            $high = ip2long(implode(".", $broadcast));
            $low = ip2long(implode(".", $network));
            if ($myIp <= $high && $low <= $myIp) {
                return array(
                    "address" => $ip,
                    "ipasn" => $ivalue,
                    "subnet" => $subnet,
                    "AddressMask" => implode(".", $ipDigital),
                    "BinAddressMask" => implode(".", $ipBinary),
                    "Netmask" => implode(".", $netmask),
                    "BinNetmask" => implode(".", $binaryNetmask),
                    "Wildcard" => implode(".", $wildcard),
                    "BinWildcard" => implode(".", $binaryWildcard),
                    "Network" => implode(".", $network),
                    "BinNetwork" => implode(".", $binaryNetwork),
                    "Broadcast" => implode(".", $broadcast),
                    "BinBroadcast" => implode(".", $binaryBroadcast),
                );
            }
        }
        return false;
    }

